import React from 'react'
import { Jumbotron } from 'react-bootstrap'

const Home = () => {
  useEffect(() => {
    if (!auth.authenticate) {
      dispatch(isUserLoggedIn())
    }
  }, [])
  return (
    <div>
      <Jumbotron
        className="text-center"
        style={{ margin: '5rem', background: 'white' }}
      >
        <h3>Welcome to Admin Dashboard</h3>
      </Jumbotron>
    </div>
  )
}

export default Home
